import React from "react";
import { useHistory } from "react-router-dom";

function Header() {
  const history = useHistory();
  const logoButton = () => {
    history.push("/hi");
  };

  return (
    <header className="header">
      <a className="header__title" onClick={logoButton}>
        NewsExplorer
      </a>
      <nav className="header__nav">
        <ui className="header__links">
          <li>
            <a href="/" className="header__link">
              Главная
            </a>
          </li>
          <li>
            <a href="/" className="header__link">
              Сохраненные статьи
            </a>
          </li>
          <button className="header__log-button"> Авторизоваться </button>
        </ui>
      </nav>
    </header>
  );
}

export default Header;
